	    check(first, isNumber, "/", "number", 1);
	    arrayEach(args, function(x, i) { check(x, isNumber, "/", "number", i+2) });
	    var i, div = first;
	    if (args.length == 0) {
		return NumberTower.divide(plt.types.Rational.ONE, div);
	    } else {
		for(i = 0; i < args.length; i++) {
		    div = NumberTower.divide(div, args[i]);
		}
		return div;    
	    }
